type InterestPaid = {
  name: string;
  value: string,
  periods: number;
};

const interestPaidFrequencies: InterestPaid[] = [
  {
    name: "Monthly",
    value: 'monthly',
    periods: 12,
  },
  {
    name: "Quarterly",
    value: 'quarterly',
    periods: 4,
  },
  {
    name: "Annually",
    value: 'annually',
    periods: 1,
  },
  {
    name: "At Maturity",
    value: 'atMaturity',
    periods: 0,
  },
];

export { interestPaidFrequencies };
